import './App.css';
import Navbar from "./navbar"

function App() {
  let component 
  switch (window.location.pathname){
    case "/":
      component = App
      break
      case "/products":
        component = Products
        break
        case "/contact-us":
          component = Contact
          break
  }
  return <><Navbar />
  <component /></>

}

export default App;
